import React from 'react'

import { Grid } from '@mui/material'

import VideoItem from './VideoItem'

const VideoList = ({ videos }) => {
    const listOfVideos = videos.map((video, id) => <VideoItem key={id} video/>)
    return listOfVideos
}

export default VideoList
